<h1 class="Section4">
<a class="Section5" href="#" id="introduction">Introduction</a>
</h1>
<div class="Section6"><br><b>Eclipse</b> est un environnement de développement intégré (IDE) utilisé dans la programmation informatique. Il contient un espace de travail de base et un système de plug-in extensible pour personnaliser l'environnement. Il s'agit du deuxième IDE le plus populaire pour le développement Java et, jusqu'en 2016, il était le plus populaire. Eclipse est écrit principalement en Java et son utilisation principale est le développement d'applications Java, mais il peut également être utilisé pour développer des applications dans d'autres langages de programmation via des plug-ins, notamment Ada, ABAP, C, C++, C#, Clojure, COBOL, D, Erlang, Fortran, Groovy, Haskell, JavaScript, Julia, Lasso, Lua, NATURAL, Perl, PHP, Prolog, Python, R, Ruby ( y compris Ruby on Rails framework), Rust, Scala et Schéma. Il peut également être utilisé pour développer des documents avec LaTeX (via un plug-in TeXlipse) et des packages pour le logiciel Mathematica. Les environnements de développement incluent les outils de développement Java Eclipse (JDT) pour Java et Scala, Eclipse CDT pour C/C++ et Eclipse PDT pour PHP, entre autres.

La base de code initiale provenait d' IBM VisualAge. Le kit de développement logiciel (SDK) Eclipse, qui comprend les outils de développement Java, est destiné aux développeurs Java. Les utilisateurs peuvent étendre ses capacités en installant des plug-ins écrits pour la plate-forme Eclipse, tels que des kits d'outils de développement pour d'autres langages de programmation, et peuvent écrire et contribuer leurs propres modules de plug-in. Depuis l'introduction de l' implémentation OSGi (Equinox) dans la version 3 d'Eclipse, les plug-ins peuvent être branchés-arrêtés dynamiquement et sont appelés bundles (OSGI). Le kit de développement logiciel (SDK) Eclipse est un logiciel gratuit et open source , publié selon les termes de la licence publique Eclipse, bien qu'il soit incompatible avec la licence publique générale GNU. C'était l'un des premiers IDE à fonctionner sous GNU Classpath et il fonctionne sans problème sous IcedTea.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
