<h1 class="Section4">
<a class="Section5" href="#" id="pdt">PDT</a>
</h1>
<div class="Section6"><br>PHP Development Tools (<b>PDT</b>) est un plugin IDE de langage pour la plateforme Eclipse et le projet open source qui le développe.

Le projet vise à englober tous les outils nécessaires pour développer des logiciels basés sur PHP. Il utilise le projet Eclipse Web Tools existant pour fournir aux développeurs des fonctionnalités PHP. Tous ces outils PHP sont faciles à utiliser et les développeurs peuvent accélérer le processus de développement en utilisant ces outils. Des plugins supplémentaires sont disponibles en tant qu'extensions PDT. PDT offre comme fonctionnalités clés, un éditeur PHP, la mise en évidence de la syntaxe, un assistant de contenu, un formateur de code, le refactoring, les modèles de code, une navigation dans le code simple et puissante, un débogage et profilage, la validation de la syntaxe.<br><br><div class="GSummary2"><div class="GSummary21 Summary4">
