<h1 class="Section4">
<a class="Section5" href="#" id="xdebug">Xdebug</a>
</h1>
<div class="Section6"><br><b>Xdebug</b> est une extension logicielle pour PHP apportant des fonctions de débogage et de profilage. Elle utilise le protocole DBGp. Xdebug propose l'exécution du code PHP pas à pas, selon des points d'arrêt, le traçage des appels des messages d'erreur, la protection contre les boucles infinies, le profilage du code, l'analyse de la couverture de code, le débogueur front-end.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
